function Scroll(){var n=[],t=[],i=$(window).scrollTop(),r=200;$(".navbar-collapse").find(".scroll a").each(function(){n.push($($(this).attr("href")).offset().top);t.push($($(this).attr("href")).offset().top+$($(this).attr("href")).height())});$.each(n,function(t){i>n[t]-r&&$(".navbar-collapse li.scroll").removeClass("active").eq(t).addClass("active")})}$(window).scroll(function(){Scroll()});$(".navbar-collapse ul li a").click(function(){return $("html, body").animate({scrollTop:$(this.hash).offset().top-79},1e3),!1});